import React from 'react';
import styled, { css } from 'styled-components';
import { Link, Navigate } from 'react-router-dom';
import { useState, useEffect } from 'react';
import instance from '../api/axiosInstance';


const Header = styled.nav
`
  position: fixed;
  top: 0;
  left: 0;
  height: 70px;
  width: 100%;
  background-color: var(--nav-color);
  z-index: 100;

  ${props => props.dark && css`
    border: 1px solid #393838;
  `}
`;

const NavBarContainer = styled.div`
  position: relative;
  height: 100%;
  max-width: 1000px;
  width: 100%;
  background-color: var(--nav-color);
  margin: 0 auto;
  padding: 0 30px;
  display: flex;
  align-items: center;
  justify-content: space-between;
`;

const SidebarOpen = styled.div`
  color: var(--text-color);
  font-size: 25px;
  padding: 5px;
  cursor: pointer;
  display: none;
`;

const Logo = styled.div`
  font-size: 25px;
  font-weight: 500;
  color: var(--text-color);
  text-decoration: none;
`;

const NavLinks = styled.ul`
  display: flex;
  align-items: center;
`;

const NavLink = styled.li`
  margin: 0 5px;
  list-style: none;

  a {
    position: relative;
    font-size: 17px;
    font-weight: 400;
    color: var(--text-color);
    text-decoration: none;
    padding: 10px;

    &::before {
      content: '';
      position: absolute;
      left: 50%;
      bottom: 0;
      transform: translateX(-50%);
      height: 6px;
      width: 6px;
      border-radius: 50%;
      background-color: var(--text-color);
      opacity: 0;
      transition: all 0.3s ease;
    }

    &:hover::before {
      opacity: 1;
    }
  }
`;

const DarkLightToggle = styled.div`
  display: flex;
  align-items: center;
`;

const ToggleIcon = styled.i`
  position: absolute;
  color: var(--text-color);
  font-size: 22px;
  cursor: pointer;
  transition: all 0.3s ease;
`;

const SunIcon = styled(ToggleIcon)`
  opacity: 0;
  pointer-events: none;
`;

const MoonIcon = styled(ToggleIcon)`
  opacity: 0;
  pointer-events: none;
`;

const CancelIcon = styled(ToggleIcon)`
  opacity: 0;
  pointer-events: none;
`;

const SearchIcon = styled(ToggleIcon)`
  opacity: 0;
  pointer-events: none;
`;

const SearchBox = styled.div`
  position: relative;
`;

const SearchField = styled.div`
  position: absolute;
  bottom: -85px;
  right: 5px;
  height: 50px;
  width: 300px;
  display: flex;
  align-items: center;
  background-color: var(--nav-color);
  padding: 3px;
  border-radius: 6px;
  box-shadow: 0 5px 5px rgba(0, 0, 0, 0.1);
  opacity: 0;
  pointer-events: none;
  transition: all 0.3s ease;

  &::before {
    content: '';
    position: absolute;
    right: 14px;
    top: -4px;
    height: 12px;
    width: 12px;
    background-color: var(--nav-color);
    transform: rotate(-45deg);
    z-index: -1;
  }

  input {
    height: 100%;
    width: 100%;
    padding: 0 45px 0 15px;
    outline: none;
    border: none;
    border-radius: 4px;
    font-size: 14px;
    font-weight: 400;
    color: var(--search-text);
    background-color: var(--search-bar);
  }

  ${props => props.active && css`
    bottom: -74px;
    opacity: 1;
    pointer-events: auto;
  `}
`;




const Navbar = () => {

const token = localStorage.getItem('token');

const [darkMode, setDarkMode] = useState(false);
const [searchActive, setSearchActive] = useState(false);

  const logout = () => {
    localStorage.removeItem('token');
    window.location.reload();

  };

  const handleDarkModeToggle = () => {
    setDarkMode(!darkMode);
  };

  const handleSearchToggle = () => {
    setSearchActive(!searchActive);
  };

  const [user, setUser] = useState<any>(null);


  useEffect(() => {
   
    const fetchUser = async () => {

       try {
         const res = await instance.get('/profile')
         setUser(res.data)
         console.log(res.data.user)
       } catch (error) {
            console.log(error)

       }
    }

     fetchUser();


  }, [token]);







  return (
    <Header dark={darkMode}>
      <NavBarContainer>
        <SidebarOpen></SidebarOpen>
        <Logo>
          <a href="#">Logo</a>
        </Logo>
        <NavLinks>
          <NavLink>
            <a href="#">Link 1</a>
          </NavLink>
          <NavLink>
            <a href="#">Link 2</a>
          </NavLink>
          <NavLink>
            <a href="#">Link 3</a>
          </NavLink>
        </NavLinks>
        <DarkLightToggle>
          <SunIcon className={darkMode ? 'sun' : ''} onClick={handleDarkModeToggle} />
          <MoonIcon className={darkMode ? '' : 'moon'} onClick={handleDarkModeToggle} />
          <SearchIcon onClick={handleSearchToggle} />
        </DarkLightToggle>
        <SearchBox>
          <CancelIcon className={searchActive ? 'cancel' : ''} onClick={handleSearchToggle} />
          <SearchField active={searchActive}>
            <input type="text" placeholder="Search..." />
            <SearchIcon className={searchActive ? 'search' : ''} />
          </SearchField>
        </SearchBox>
      </NavBarContainer>
    </Header>
  );
};

export default Navbar;
